Jessica met Voodoo for lunch and little did Voodoo know she was not interested in eating but instead just wanted an afternoon delight. She mentioned to him how she was in the mood for a footlong hot dog and Voodoo was so hungry he never picked up on the giant hint. Jessica had him turn right and drive back to where his buddy was letting him stay to watch over his house, and he was still wondering why they were not on the way to the restaurant. Sometimes guys can only think of food when they are hungry but once Jessica hiked down her skirt and let her plump rump bust out just a little, Voodoo was finally on the same page. He stuck his wiener in between her big buns and relished in it.
